import React from "react";
import { users } from "../../data/data";
const Table = () => {
  return (
    <div className="pnl convex-1">
      {Object.keys(users[0]).map((x) => {
        return (
          <div className="col-auto">
            {users.map((y) => {
              return <div className="row no-gutters">{y[x]}</div>;
            })}
          </div>
        );
      })}
    </div>
  );
};

export default Table;
